import React, { useState, useEffect } from 'react';
import './App.css';
import Axios from 'axios';

function App() {

  const [name, setName] = useState('');
  const[pkmtype, setPkmtype] = useState('');

  const submitPokemon = () => {
    Axios.post("http://localhost:3001/api/insert", {
      pkmName:name, 
      pkmType:pkmtype,
    }).then(()=>{
      alert('successful insert');
    });

  };

  return (
  <div className="App">
    <h1>CRUD APPLICATION</h1>

    <div className = 'form'>
      <label>Pokemon Name</label>
      <input 
        type="text" 
        name = "pkmName" 
        onChange={(e)=>{
          setName(e.taget.value);
      }} 
      />

      <label>Type</label>
      <input
         type="text" 
         name = "pkmType" 
         onChange={(e)=>{
          setPkmtype(e.taget.value);
       }}
      />

      <button onClick={submitPokemon}> Submit </button>
    </div>

  </div>
  );
}

export default App;
